import React from "react";

function NovasPesquizas(props){
    const{link,image,descricao}=props;
    return(
        <div className="NovasPesquisas">
            <a href={element.link}>
            <img src={element.image}/>
            </a>
            <p>{element.descricao}</p>
        </div>
    )
}

export default NovasPesquizas
